const humano = (type)=>{
  const cultures = [garundi, keleshita, kellid, mwangi, nidalês, shoanti, taldano, tianês, ulfeno, varisiano, vudrani]

  if (type == neutral) {
    stop = false
    let culture_neutral
    while (stop == false) {
      const number = random_number(0, cultures.length)
      culture_neutral = cultures[number]
      try {
        return culture_neutral.neutral()
        stop = true
      } catch(e) {
      }
    }
  }
  
  const number = random_number(0, cultures.length)
  culture = cultures[number]

  if (type == female) {
    return culture.female()
  } else {
    return culture.male()
  }


}
